import React, { useEffect, useState } from "react";
import CartService from "../services/cart-service";
const Cart = () => {
  let [cartData, setCartData] = useState(null);
  console.log(cartData);
  useEffect(() => {
    CartService.getCart()
      .then((data) => {
        setCartData(data.data);
      })
      .catch((e) => {
        console.log(e);
      });
  }, []);
  return <div>購物車</div>;
};

export default Cart;
